import { useState, useEffect } from 'react';
import axios from 'axios';

function App() {


  const [getNotes, setNotes] = useState('')


  useEffect(() => {
    axios.get(`https://restcountries.com/v3.1/all`).then(
      (response) => {
        const axiosResponse = [];
        axiosResponse.push(response.data)
        setNotes(axiosResponse)
        return;
      }
    );
  }, [getNotes]);

  return (
    <>
      <>
        <h1>Work in Progress!</h1>
      </>
      <>
        <ul>
          {getNotes.map((countryObject) => {
            return <li>{countryObject.name.common}</li>;
          })}
        </ul>
      </>
    </>
  )
}



export default App;
